import React from "react";
import Col from "react-bootstrap/Col";
import Figure from "react-bootstrap/Figure";
import FigureCaption from "react-bootstrap/FigureCaption";
import ElsCard from "./images/projects/els-card2.png";
//import BedBabyCard from "./images/projects/bed-baby-card.png";
//import FreitagCard from "./images/projects/freitag-card.jpg";

const Projects = () => {
  return (
    <div>
      <h1>Projects</h1>
      <p className="bold">
        Here are a few design and developent projects I've worked on.
      </p>
      <div className="spacer-large" />
      <div>
        <Row>
          <Col>
            <Figure className="test-figure">
              <img src={ElsCard} alt="ELS" />
              <FigureCaption>
                <p>
                  I led team in the redesign of els.edu to create an intuitive,
                  user-centric responsive site with best-in-class UX/UI. I also
                  helped to lead team in the development of the redesigned site
                  to create a seamless experience across multiple devices and
                  fast browsing. We achieved annual lead targets by increasing
                  student applications and enrollments after the new site was
                  launched.
                </p>
              </FigureCaption>
              <div className="overlay"></div>
            </Figure>
          </Col>
        </Row>
      </div>
    </div>
  );
};

export default Projects;
